  `PriorEducationId` int(11) NOT NULL AUTO_INCREMENT,
  `NeuId` varchar(16) DEFAULT NULL,
  `InstitutionName` varchar(100) DEFAULT NULL,
  `MajorName` varchar(255) DEFAULT NULL,
